import "bootstrap/dist/css/bootstrap.min.css";
import { ListGroup } from "react-bootstrap";

class PlaylistPicker extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ListGroup>
          <ListGroup.Item> Eat food </ListGroup.Item>
        </ListGroup>
      </div>
    );
  }
}

export default PlaylistPicker;
